import { useEffect, useState, useRef } from 'react';

/* ===== MAP PARAMS ===== */
const GRID_SIZE = 20;
const MAP_SIZE = 800;
const GRID_COUNT = MAP_SIZE / GRID_SIZE;

function App() {
  const [gridMap, setGridMap] = useState({});
  const [selectedCells, setSelectedCells] = useState([]);

  const [isDragging, setIsDragging] = useState(false);
  const draggedRef = useRef(false);

  /* ===== COORD MAPPING ===== */
  const [coordStep, setCoordStep] = useState('IDLE'); // IDLE | COLLECT
  const [coordPoints, setCoordPoints] = useState([]); // {gx, gy, x?, y?}

  /* ===== JSON LOAD ===== */
  useEffect(() => {
    fetch('/semantic_grid_map.json')
      .then(res => res.ok ? res.json() : null)
      .then(data => {
        if (data?.grid) setGridMap(data.grid);
      });
  }, []);

  /* ===== GRID CLICK ===== */
  const handleGridClick = (gx, gy) => {
    setSelectedCells(prev => {
      const exists = prev.some(c => c.x === gx && c.y === gy);
      return exists
        ? prev.filter(c => !(c.x === gx && c.y === gy))
        : [...prev, { x: gx, y: gy }];
    });
  };

  /* ===== MOUSE EVENTS ===== */
  const handleMouseUp = (e) => {
    setIsDragging(false);

    if (draggedRef.current) return;

    const rect = e.currentTarget.getBoundingClientRect();
    const gx = Math.floor((e.clientX - rect.left) / GRID_SIZE);
    const gy = Math.floor((e.clientY - rect.top) / GRID_SIZE);

    handleGridClick(gx, gy);

    if (coordStep === 'COLLECT') {
      setCoordPoints(prev => {
        if (prev.length >= 5) return prev;
        return [...prev, { gx, gy }];
      });
    }
  };

  /* ===== APPLY GRID COORDINATES ===== */
  const applyGridCoordinates = () => {
    if (coordPoints.length !== 5) {
      alert('점 5개를 먼저 찍으세요');
      return;
    }

    const labels = [
      '중심 (0,0)',
      '왼쪽 위',
      '오른쪽 위',
      '왼쪽 아래',
      '오른쪽 아래',
    ];

    const completed = coordPoints.map((p, i) => {
      const x = Number(prompt(`${labels[i]} X`));
      const y = Number(prompt(`${labels[i]} Y`));
      return { ...p, x, y };
    });

    const [origin, lt, rt, lb] = completed;

    const gridW = rt.gx - lt.gx;
    const gridH = lb.gy - lt.gy;
    const worldW = rt.x - lt.x;
    const worldH = lb.y - lt.y;

    const dx = worldW / gridW;
    const dy = worldH / gridH;

    setGridMap(prev => {
      const updated = { ...prev };

      Object.keys(updated).forEach(key => {
        const [gx, gy] = key.split(',').map(Number);

        const wx = lt.x + (gx - lt.gx) * dx;
        const wy = lt.y + (gy - lt.gy) * dy;

        updated[key] = {
          ...updated[key],
          explicit: {
            grid: { gx, gy },
            world: {
              x: +wx.toFixed(3),
              y: +wy.toFixed(3),
            },
          },
        };
      });

      return updated;
    });

    setCoordPoints([]);
    setCoordStep('IDLE');
    alert('좌표 매핑 완료');
  };

  return (
    <div style={{ display: 'flex' }}>
      {/* MAP */}
      <div
        style={{
          width: MAP_SIZE,
          height: MAP_SIZE,
          position: 'relative',
          border: '1px solid black',
        }}
        onMouseDown={() => {
          draggedRef.current = false;
          setIsDragging(true);
        }}
        onMouseMove={() => {
          if (isDragging) draggedRef.current = true;
        }}
        onMouseUp={handleMouseUp}
      >
        {/* GRID */}
        {[...Array(GRID_COUNT)].map((_, i) => (
          <div key={i} style={{
            position: 'absolute',
            left: i * GRID_SIZE,
            top: 0,
            width: 1,
            height: '100%',
            background: 'rgba(0,0,0,0.2)',
          }} />
        ))}

        {/* SELECTED */}
        {selectedCells.map(({ x, y }) => (
          <div key={`${x},${y}`} style={{
            position: 'absolute',
            left: x * GRID_SIZE,
            top: y * GRID_SIZE,
            width: GRID_SIZE,
            height: GRID_SIZE,
            background: 'rgba(0,0,255,0.3)',
            pointerEvents: 'none',
          }} />
        ))}
      </div>

      {/* PANEL */}
      <div style={{ marginLeft: 20 }}>
        <button
          onClick={() => {
            setCoordPoints([]);
            setCoordStep('COLLECT');
            alert('중심 → 좌상 → 우상 → 좌하 → 우하 순서로 5점 클릭');
          }}
        >
          Start Coordinate Mapping
        </button>

        <button onClick={applyGridCoordinates}>
          Apply Grid Coordinates
        </button>

        <pre>{JSON.stringify(coordPoints, null, 2)}</pre>
      </div>
    </div>
  );
}

export default App;
